import React from "react";
import "../../../Styles/Pages/Home/HomeFourth.scss";
import ArenaCard from "../../Shared/ArenaCard";
import ArenaSecondCard from "../../Shared/ArenaSecondCard";

function HomeFourth() {
  return (
    <div className='homeFourth'>
      <ArenaCard />
      <ArenaSecondCard />
    </div>
  );
}

export default HomeFourth;
